  `statisticsCode` varchar(500) COLLATE utf8_bin DEFAULT NULL COMMENT '网站统计',
  PRIMARY KEY (`id`),
  KEY `cms_site_del_flag` (`del_flag`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='站点表';

